(6, 1, 9, NULL, 'Cranzo Battery Jumper Cable 2 Meter', '<p>Easily boost a dead car battery back to life with help from Cranzo Basics jumper cables. The jumper cables utilize a second battery, typically from another car, to give the drained or completely dead battery an extra boost of energy. Whether needing a jump-start or coming to the rescue for someone else, the jumper cables make a useful addition to any trunk&rsquo;s auto-care collection of tools.</p>\r\n', '<p>Suitable for the biggest of cranking applications, rated at 500 AMPS, they are heavy enough to start a cold diesel in winter or can be used for general day to day duties</p>\r\n\r\n<p>Fitted with surge protection to accommodate later model vehicles with engine computersNo need to check your vehicle, these will be fine for all vehicles</p>\r\n', 'JJ001', 1000.00, 550.00, 45.00, '30', '7', '30', 'Inch', 1, 0, 1, '2020-04-09 10:50:12'),
