(209, 1, 18, NULL, 'Cranzo Steel Automotive Car Fan For 6 Inches For Maruti Suzuki Gypsy', '<p>Cranzo 6 inch 12 volt car/truck /van fan 12 volt fan will work in cars, trucks, boats, anything with a 12 volt power supply. Inline high low on/off switch. 2 speed. Can be tilted up or down.Oscillating on/off switch on body of fan. Oscillating (moves from side to side). 7 inch all metal grill. Includes wiring, switch and 2 screws</p>\r\n', '<p>Cranzo Steel Automotive Car Fan For 6 Inches For Maruti Suzuki Gypsy</p>\r\n\r\n<ul>\r\n	<li>12 volt fan will work in cars, anything with a 12 volt power supply, inline high low on/off switch</li>\r\n	<li>Oscillating on/off switch on body of fan, oscillating (moves from side to side)</li>\r\n</ul>\r\n', 'RR5127', 1000.00, 699.00, 30.10, '6', '6', '6', 'Inch', 1, 0, 1, '2020-04-18 10:41:10'),
(210, 10, 24, NULL, 'Sticky Sun Shades Window For Any Car Set of 4, Black', '<p>Keeping your car cool will not be a problem this summer with kingsway car side window foldable sticky sun shades, it not only keeps your car cool but also provide you privacy as well. Features : Easy installation using suction cup provided for the sun shades..</p>\r\n', '<ul>\r\n	<li>Vehicle compatibility : All Car</li>\r\n	<li>Block sun heat in car</li>\r\n	<li>Keeps the car cool</li>\r\n	<li>Maintains privacy</li>\r\n	<li>Easily foldable</li>\r\n</ul>\r\n', 'Su001', 500.00, 199.00, 60.20, '10', '5', '10', 'Inch', 1, 0, 1, '2020-04-18 11:58:42'),
(211, 6, 26, NULL, 'Universal Disk Brake Lock for Bikes', '<p>BikenWear Bike Disk Brake Lock is made from a solid cast of steel, iron and zinc alloy, this compact anti theft device packs a punch. A hardened steel locking pin makes this device almost impossible to drill, saw, cut or hammer off. The thieves startled seeing a light turn on run out of your garage leaving your bike unharmed. This stylish compact theft deterrent is simple and can be stored almost anywhere, even your pocket until it is needed for duty. You are not going to find a more economical yet effective tool on the market that compares to the security and peace of mind this little device will add to your bike.</p>\r\n', '<ul>\r\n	<li>Made from a solid cast of steel, iron and zinc alloy</li>\r\n	<li>Simple and can be stored almost anywhere</li>\r\n	<li>Hardened steel locking pin makes this device almost impossible to drill, saw, cut or hammer off</li>\r\n</ul>\r\n', 'LL001', 500.00, 299.00, 40.20, '20', '', '', '', 1, 0, 1, '2020-04-18 12:01:49'),
