(278, 11, 28, NULL, 'Cranzo Bike Body Cover For Hero Glamour FI', '<p>Cranzo Vehicle Covers will ensure that your vehicle is protected well against external factors such as dust, rain and dirt. The elastic bottom ensures it fits well onto your vehicle. And the water resistant material protects it from the rains.</p>\r\n', '<p>scratches and sun damage<br />\r\nStrap Type: Elastic, Tie Strap<br />\r\n&nbsp;Features mirror pockets<br />\r\nhigh quality premium fabric<br />\r\nProtect your motorbike</p>\r\n\r\n<p>Fabric Black polyster</p>\r\n\r\n<p>If any question regarding this product please contact : 8882537223</p>\r\n', 'BB0027', 500.00, 299.00, 40.20, '10', '5', '10', 'Inch', 1, 0, 1, '2020-04-19 13:11:49');
